const ListItem = ({
    image,
    name,

}) => (
    <li className="ListItem__wrapper">
        <img 
            className="ListItem__image"
            src={image}
            alt={name}
        />
        <div>
            <h2 className="ListItem__name">{name}</h2>
            <p className="ListItem__description">{description}</p>
        </div>
    </li>
)
  


export default ListItem;
